#####################################################################
#   Homing and Gantry Adjustment Routines
#####################################################################

[idle_timeout]
timeout: 1800

#[safe_z_home]
##  XY Location of the Z Endstop Switch
##  Update -10,-10 to the XY coordinates of your endstop pin 
##  (such as 157,305) after going through Z Endstop Pin
##  Location Definition step.
#home_xy_position:300,300
#home_xy_position:175,175
#speed:100
#z_hop:3


[quad_gantry_level]
gantry_corners:
   -60,-10
   410,420
points:
   50,25
   50,275
   300,275
   300,25
speed: 350
horizontal_move_z: 5
retries: 5
retry_tolerance: 0.0075
max_adjust: 10

#####################################################################
#   Extruder
#####################################################################
[extruder]
step_pin: SB2209:PD0
dir_pin: SB2209:PD1
enable_pin: !SB2209:PD2
##  Update value below when you perform extruder calibration
##  If you ask for 100mm of filament, but in reality it is 98mm:
##  rotation_distance = <previous_rotation_distance> * <actual_extrude_distance> / 100
##  22.6789511 is a good starting point
##  rotation_distance: 22.6789511   #Bondtech 5mm Drive Gears
rotation_distance: 23.3139617308
pressure_advance: 0.03
##  Update Gear Ratio depending on your Extruder Type
##  Use 50:17 for Afterburner/Clockwork (BMG Gear Ratio)
##  Use 80:20 for M4, M3.1
gear_ratio: 50:10               #BMG Gear Ratio
microsteps: 32
full_steps_per_rotation: 200    #200 for 1.8 degree, 400 for 0.9 degree
nozzle_diameter: 0.400
filament_diameter: 1.75
instantaneous_corner_velocity: 1.5
max_extrude_cross_section: 10.0
max_extrude_only_distance: 50000
heater_pin: SB2209:PB13 # Heat0
pwm_cycle_time: 0.02
smooth_time: 0.5
max_power: 0.8
sensor_type: ATC Semitec 104GT-2
sensor_pin: SB2209: PA3
#control: pid
min_extrude_temp: 0
min_temp: 0
max_temp: 300

[tmc2209 extruder]
uart_pin: SB2209:PA15
interpolate: False
#   If true, enable step interpolation (the driver will internally
#   step at a rate of 256 micro-steps). The default is True.
run_current: 0.85
#   The amount of current (in amps RMS) to configure the driver to use
#   during stepper movement. This parameter must be provided.
#stealthchop_threshold: 999999
stealthchop_threshold: 0
#   The velocity (in mm/s) to set the "stealthChop" threshold to. When
#   set, "stealthChop" mode will be enabled if the stepper motor
#   velocity is below this value. The default is 0, which disables
#   "stealthChop" mode.

########################################
# EXP1 / EXP2 (display) pins
########################################

[board_pins]
aliases:
    # EXP1 header
    EXP1_1=PE8, EXP1_2=PE7,
    EXP1_3=PE9, EXP1_4=PE10,
    EXP1_5=PE12, EXP1_6=PE13,    # Slot in the socket on this side
    EXP1_7=PE14, EXP1_8=PE15,
    EXP1_9=<GND>, EXP1_10=<5V>,

    # EXP2 header
    EXP2_1=PA6, EXP2_2=PA5,
    EXP2_3=PB1, EXP2_4=PA4,
    EXP2_5=PB2, EXP2_6=PA7,      # Slot in the socket on this side
    EXP2_7=PC15, EXP2_8=<RST>,
    EXP2_9=<GND>, EXP2_10=<5V>

[bed_mesh]
    speed: 250
    horizontal_move_z: 10

    mesh_min: 15, 20
    mesh_max: 335,315

    fade_start: 0.6
    fade_end: 10.0
    probe_count: 45, 45 # Values should be odd, so one point is directly at bed center
    #probe_count: 9,9 # Values should be odd, so one point is directly at bed center
    algorithm: bicubic
    #relative_reference_index: 12 # Update when changing probe_count, to ((x points * y points) - 1) / 2. (the center point)
    #relative_reference_index: 40 # Update when changing probe_count, to ((x points * y points) - 1) / 2. (the center point)
    #relative_reference_index: 24 # Update when changing probe_count, to ((x points * y points) - 1) / 2. (the center point)

#####################################################################
#   Macros
#####################################################################

[gcode_macro G32]
gcode:
    M117 Saving GCODE State
    SAVE_GCODE_STATE NAME=STATE_G32
    M117 Running G90
    G90
    M117 Running G25
    G28
    M117 Running QGL
    QUAD_GANTRY_LEVEL
    M117 Running G28
    G28
    ##  Uncomment for for your size printer:
    #--------------------------------------------------------------------
    ##  Uncomment for 250mm build
    #G0 X125 Y125 Z30 F3600
    
    ##  Uncomment for 300 build
    #G0 X150 Y150 Z30 F3600
    
    ##  Uncomment for 350mm build
    M117 Running G0
    G0 X175 Y175 Z30 F3600
    #--------------------------------------------------------------------
    #status_meshing
    #STATUS_MESHING
    M117 Running BED_MESH_CALIBRATE
    
    #BED_MESH_CALIBRATE

    #STOP_LED_EFFECTS
    #WHITE_LED
    M117 Restoring GCODE State
    RESTORE_GCODE_STATE NAME=STATE_G32
    M117



   

#   Use PRINT_END for the slicer ending script - please customise for your slicer of choice
[gcode_macro PRINT_END]
gcode:
    # safe anti-stringing move coords
    {% set th = printer.toolhead %}
    {% set x_safe = th.position.x + 20 * (1 if th.axis_maximum.x - th.position.x > 20 else -1) %}
    {% set y_safe = th.position.y + 20 * (1 if th.axis_maximum.y - th.position.y > 20 else -1) %}
    {% set z_safe = [th.position.z + 2, th.axis_maximum.z]|min %}
    
    SAVE_GCODE_STATE NAME=STATE_PRINT_END
    
    M400                           ; wait for buffer to clear
    G92 E0                         ; zero the extruder
    G1 E-5.0 F1800                 ; retract filament
    
    TURN_OFF_HEATERS
    
    G90                                      ; absolute positioning
    G0 X{x_safe} Y{y_safe} Z{z_safe} F20000  ; move nozzle to remove stringing
    G0 X{th.axis_maximum.x//2} Y{th.axis_maximum.y - 2} F3600  ; park nozzle at rear
    #G0 X0 Y0 F3600
    M107                                     ; turn off fan
    
    BED_MESH_CLEAR
    RESTORE_GCODE_STATE NAME=STATE_PRINT_END

